static QUOTE_23_22_0: Minute = Minute {title: "The Midnight Library", author: "Matt Haig", start: "“It began to rain again, so she sat there with the blinds open, staring at the drops on the glass.\nThe time was now ", time: "twenty-two minutes past eleven", end: ".\nShe knew only one thing with absolute certainty: she didn’t want to reach tomorrow. She stood up. She found a pen and a piece of paper.\nIt was, she decided, a very good time to die.”"};
static QUOTE_23_22_1: Minute = Minute {title: "Dreams of leaving", author: "Robert Thomson", start: "At ", time: "11.22", end: " he handed his ticket to a yawning guard and walked down a long flight of wooden steps to the car-park. A breeze lifted and dropped the leaves of a tree, and he thought of the girl with the blonde hair. His bicycle lay where he had left it."};
static QUOTE_23_25_0: Minute = Minute {title: "Other People's Money", author: "Justin Cartwright", start: "“OK, Estelle, I willl be at Nice Airport at ", time: "11.25 p.m.", end: " on Saturday, BA: Could you send the driver?\""};
static QUOTE_23_25_1: Minute = Minute {title: "A Wireless Message", author: "Ambrose Bierce", start: "To test the intensity of the light whose nature and cause he could not determine, he took out his watch to see if he could make out the figures on the dial. They were plainly visible, and the hands indicated the hour of ", time: "eleven o'clock and twenty-five minutes", end: ". At that moment the mysterious illumination suddenly flared to an intense, an almost blinding splendor…"};
static QUOTE_23_26_0: Minute = Minute {title: "American Gods", author: "Neil Gaiman", start: "Los Angeles. ", time: "11:26 p.m.", end: " In a dark red room- the color of the walls is close to that of raw liver- is a tall woman dressed cartoonishly in too-tight silk shorts, her breasts pulled up and pressed forward by the yellow blouse tied beneath them."};
static QUOTE_23_27_0: Minute = Minute {title: "Other People's Money", author: "Justin Cartwright", start: "He tells his old friend the train times and they settle on the 19.45 arriving at ", time: "23.27", end: ". “I’ll book us into the ultra-luxurious Francis Drake Lodge. Running water in several rooms. Have you got a mobile?\""};
static QUOTE_23_30_0: Minute = Minute {title: "If it Bleeds", author: "Stephen King", start: "He came into their bedroom at just past ", time: "eleven-thirty", end: ". He’d taken his muddy shoes off downstairs, and was trying to be quiet, but he heard the rustle of bedclothes in the dark and knew she was awake."};
static QUOTE_23_30_1: Minute = Minute {title: "The Goldfinch", author: "Donna Tartt", start: "And so it was that around ", time: "half past eleven", end: ", I found myself riding down to the Village on the Fifth Avenue bus with the street address of Hobart and Blackwell in my pocket, written on a page from one of the monogrammed notepads Mrs Barbour kept by the telephone."};
static QUOTE_23_30_2: Minute = Minute {title: "One Flew Over the Cuckoo’s Nest", author: "Ken Kesey", start: "“I will be a sonofa****h if he ain’t in here at ", time: "eleven-thirty at night", end: ", fartin’ around in the dark with a pair of scissors and a paper sack.”"};
static QUOTE_23_30_3: Minute = Minute {title: "Infinite Jest", author: "David Foster Wallace", start: "He loaded the player and turned on the viewer, his knees popping again as he squatted to set the cue to ", time: "2330", end: "."};
static QUOTE_23_30_4: Minute = Minute {title: "'The Dismissal', in Midnight Mass & Other Stories", author: "Paul Bowles", start: "He would catch the night bus for Casablanca, the one that left the beach at ", time: "half past eleven", end: "."};
static QUOTE_23_30_5: Minute = Minute {title: "“The Voyage”", author: "Katherine Mansfield", start: "The Picton boat was due to leave at ", time: "half-past eleven", end: ". It was a beautiful night, mild, starry, only when they got out of the cab and started to walk down the Old Wharf that jutted out into the harbour, a faint wind blowing off the water ruffled under Fenella’s hat, and she put up her hand to keep it on."};
static QUOTE_23_30_6: Minute = Minute {title: "Under Milk Wood", author: "Dylan Thomas", start: "The ship’s clock in the bar says ", time: "half past eleven", end: ". Half past eleven is opening time. The hands of the clock have stayed still at half past eleven for fifty years."};
static QUOTE_23_31_0: Minute = Minute {title: "Midnight's Children", author: "Salman Rushdie", start: "It is ", time: "twenty-nine minutes to midnight", end: ". Dr Narlikar’s Nursing Home is running on a skeleton staff; there are many absentees, many employees who have preferred to celebrate the imminent birth of the nation, and will not assist tonight at the births of children."};
static QUOTE_23_32_0: Minute = Minute {title: "The Evenings", author: "Gerard Reve", start: "“This is the evening. This is the night. It is New Year´s Eve. ", time: "In about twenty-eight minutes it will be midnight.", end: " I still have twenty-eight minutes left. I have to recollect my thoughts. At twelve o´clock, I should be done thinking.” He looked at his father. “Help those that are depressed and consider themselves lost in this world,” he thought. “Old fart.\""};
static QUOTE_23_32_1: Minute = Minute {title: "The Curious Incident of the Dog in the Night-time", author: "Mark Haddon", start: "And then it started to rain and I got wet and I started shivering because I was cold. And then it was ", time: "11.32 pm", end: " and I heard voices of people walking along the street. And a voice said, ‘I don’t care whether you thought it was funny or not,’ and it was a lady’s voice."};
static QUOTE_23_33_0: Minute = Minute {title: "Midnight's Children", author: "Salman Rushdie", start: "We are on Colaba Causeway now, just for a moment, to reveal that at ", time: "twenty-seven minutes to midnight", end: ", the police are hunting for a dangerous criminal. His name: Joseph D'Costa. The orderly is absent, has been absent for several days, from his work at the Nursing Home, from his room near the slaughterhouse, and from the life of a distraught virginal Mary"};
static QUOTE_23_34_0: Minute = Minute {title: "American Psycho", author: "Bret Easton Ellis", start: "", time: "Eleven thirty-four", end: ". We stand on the sidewalk in front of Jean’s apartment on the Upper East Side. Her doorman eyes us warily and fills me with a nameless dread, his gaze piercing me from the lobby. A curtain of stars, miles of them, are scattered, glowing, across the sky and their multitude humbles me, which I have a hard time tolerating. She shrugs and nods after I say something about forms of anxiety. It’s as if her mind is having a hard time communicating with her mouth, as if she is searching for a rational analysis of who I am, which is, of course, an impossibility: there … is … no … key."};
static QUOTE_23_34_1: Minute = Minute {title: "The Hard Way", author: "Lee Child", start: "Reacher retrieved his G36 from under the saloon bar window at ", time: "eleven thirty-four", end: " precisely and set out to walk back on the road, which he figured would make the return trip faster."};
static QUOTE_23_35_0: Minute = Minute {title: "Hamlet, Revenge!", author: "Michael Innes", start: "Then at ", time: "eleven thirty-five", end: " the door at the rear of the hall opened and a police sergeant and three constables entered, ushered by Bagot."};
static QUOTE_23_36_0: Minute = Minute {title: "Infinite Jest", author: "David Foster Wallace", start: "Then Green knocks at the front door at ", time: "2336", end: " - Gately has to Log the exact time and then it’s his call whether to unlock the door."};
static QUOTE_23_39_0: Minute = Minute {title: "Old Possum's Book of Practical Cats", author: "T S Eliot", start: "There’s a whisper down the line at ", time: "11.39", end: " When the Night Mail’s ready to depart, Saying “Skimble where is Skimble has he gone to hunt the thimble? We must find him or the train can’t start.\""};
static QUOTE_23_40_0: Minute = Minute {title: "The Rosie Project", author: "Graeme Simsion", start: "I went to the kitchen to select another bottle, deciding to reduce the next day’s alcohol intake to compensate. Then I saw the clock: ", time: "11:40pm", end: ". I picked up the phone and ordered a taxi. With any luck it would arrive before the after-midnight tariff commenced."};
static QUOTE_23_40_1: Minute = Minute {title: "Behind the Lie", author: "Emilya Naymark", start: "", time: "Twenty minutes before midnight", end: ",  before Oliver put an end to the festivities, she gave in to her impulse and texted her son, reminding him of their mutually agreed-upon curfew."};
static QUOTE_23_40_2: Minute = Minute {title: "Dracula", author: "Bram Stoker", start: "We all have the maps and appliances of various kinds that can be had. Professor Van Helsing and I are to leave by the ", time: "11:40", end: " train tonight for Veresti, where we are to get a carriage to drive to the Borgo Pass. We are bringing a good deal of ready money, as we are to buy a carriage and horses."};
static QUOTE_23_41_0: Minute = Minute {title: "Noble House", author: "James Clavell", start: "In a little while his mind cleared, but his head ached, arms ached, body ached. The phosphorescent figures on his watch attracted his attention. He peered at them. The time was ", time: "11:41", end: ". I remember…what do I remember?"};
static QUOTE_23_42_0: Minute = Minute {title: "The Woman Downstairs", author: "Elisabeth Carpenter", start: "The front door opens. Her heart pounds. She looks at the time on the bottom right of her screen. ", time: "11.42", end: "."};
static QUOTE_23_42_1: Minute = Minute {title: "Old Possum's Book of Practical Cats", author: "TS Eliot", start: "At ", time: "11.42", end: " then the signal’s nearly due And the passengers are frantic to a man- Then Skimble will appear and he’ll saunter to the rear:"};
static QUOTE_23_43_0: Minute = Minute {title: "Talking to Strange Men", author: "Ruth Rendell", start: "The clock told him it was ", time: "eleven forty-three", end: " and in that moment, in a flash of illumination, Mungo understood what the numbers at the end of Moscow Centre’s messages were"};
static QUOTE_23_44_0: Minute = Minute {title: "Dead Famous", author: "Ben Elton", start: "‘At ", time: "eleven forty-four", end: " last night somebody stabbed this girl in the neck with a kitchen knife and immediately thereafter plunged the same knife through her skull, where it remained.’"};
static QUOTE_23_45_0: Minute = Minute {title: "Billy Summers", author: "Stephen King", start: "Billy’s plan lasts until ", time: "quarter to midnight", end: ". He’s been watching some action movie in his underwear, and although the plot is simple—something about a guy seeking revenge on the men who killed his dog—Billy has lost the thread. He decides to call it a day."};
static QUOTE_23_45_1: Minute = Minute {title: "Oliver Twist", author: "Charles Dickens", start: "The church clocks chimed ", time: "three quarters past eleven", end: ", as two figures emerged on London Bridge. One, which advanced with a swift and rapid step, was that of a woman who looked eagerly about her as though in quest of some expected object; the other figure was that of a man…"};
static QUOTE_23_45_2: Minute = Minute {title: "Three Men in a Boat", author: "Jerome K. Jerome", start: "We struck the tow-path at length, and that made us happy because prior to this we had not been sure whether we were walking towards the river or away from it, and when you are tired and want to go to bed, uncertainties like that worry you. We passed Shiplake as the clock was striking the ", time: "quarter to twelve", end: " and then George said thoughtfully: ‘You don’t happen to remember which of the islands it was, do you?’"};
static QUOTE_23_46_0: Minute = Minute {title: "Doll: A Romance of the Mississippi", author: "Joyce Carol Oates", start: "In the Kismet Lounge, Mr. Early sees suddenly to his horror it’s ", time: "11:46 p.m.", end: " He’s been in this place far longer than he’d planned, and he’s had more to drink than he’d planned. Shame! What if, back at the E-Z, his little girl is crying piteously for him?"};
static QUOTE_23_47_0: Minute = Minute {title: "Dead Soldiers Don't Sing", author: "Rudolf Jašík", start: "If he had glanced at his watch, he would have seen that it was ", time: "thirteen minutes to midnight", end: ". And if he had been interested in what was going on, he would have heard the voices and bawling of terrified men."};
static QUOTE_23_48_0: Minute = Minute {title: "American Tabloid", author: "James Ellroy", start: "Littell arranged a private charter.He told the pilot to fly balls-to-the-wall.The little two-seater rattled and shook-Kemper couldn’t believe it. It was ", time: "11.48pm.", end: " They were thirty-six hours short of GO."};
static QUOTE_23_49_0: Minute = Minute {title: "The Boy Who Followed Ripley", author: "The Patricia Highsmith", start: "Tom shrugged. He pushed his pinkish ruffled sleeve back, and saw that it was ", time: "eleven minutes to midnight", end: ". Tom finished his coffee."};
static QUOTE_23_50_0: Minute = Minute {title: "Salted with Fire", author: "George MacDonald", start: "Oh, Mr. MacLear, he said jocularly, I am glad you have just managed to escape breaking the Sabbath! You have had a close shave! It ", time: "wants ten minutes, hardly more, to the awful midnight hour", end: "!"};
static QUOTE_23_50_1: Minute = Minute {title: "Extremely Loud and Incredibly Close", author: "Jonathan Safran Foer", start: "At ", time: "11.50pm", end: ", I got up extremely quietly, took my things from under the bed, and opened the door one millimeter at a time, so it wouldn’t make any noise."};
static QUOTE_23_51_0: Minute = Minute {title: "The Mystery of Dr Fu Manchu", author: "Sax Rohmer", start: "“Due at Waterloo at ", time: "eleven-fifty-one", end: ",” panted Smith.“That gives us thirty-nine minutes to get to the other side of the river and reach his hotel.\""};
static QUOTE_23_52_0: Minute = Minute {title: "My Year of Rest and Relaxation", author: "Ottessa Moshfegh", start: "And then the VCR broke.\nI heard the wheels spin, then whine, then screech, then stop. I hit “eject” and nothing happened. I poked at all the buttons. I unplugged and replugged the machine. I picked it up and shook it. I banged on it with the butt of my hand, then a shoe. Nothing was working. Outside, it was dark. My phone said it was January 6, ", time: "11:52 P.M.", end: ""};
static QUOTE_23_52_1: Minute = Minute {title: "The Green Man", author: "Kingsley Amis", start: "It was ", time: "eight minutes to midnight", end: ". Just nice time, I said to myself. Indoors, everything was quiet and in darkness. Splendid. I went to the bar and fetched a tumbler, a siphon of soda and a bottle of Glen Grant, took a weak drink and a pill, and settled down in the public dining-room to wait the remaining two minutes."};
static QUOTE_23_53_0: Minute = Minute {title: "The Curious Incident of the Dog in the Night-time", author: "Mark Haddon", start: "It was ", time: "7 minutes to midnight", end: ". The dog was lying on the grass in the middle of the lawn in front of Mrs. Shears' house."};
static QUOTE_23_54_0: Minute = Minute {title: "Conclave", author: "Greg Tobin", start: "His watch read ", time: "11.54pm", end: " Eastern Standard Time. Already it was nearly 6.00am in Rome. He had left a city frozen by a harsh January storm, after a bleak, wet Christmas season."};
static QUOTE_23_55_0: Minute = Minute {title: "Harry Potter and the Prisoner of Azkaban", author: "J.K. Rowling", start: "It’s ", time: "five to twelve", end: " Hermione, three turns should suffice. Good luck.\nDumbledore stepped out and lifted his wand to magically seal the door"};
static QUOTE_23_55_1: Minute = Minute {title: "Blind Willow, Sleeping Woman", author: "Haruki Murakami", start: "The band began playing “Auld Lang Syne.”\n“", time: "Eleven fifty-five", end: ",” she said, glancing at the gold watch on her pendant. “I really like ‘Auld Lang Syne.’ How about you?”\n“I prefer ‘Home on the Range.’ All those deer and antelope.”\nShe smiled. “You must really like animals.”\n“I do,” I said. And I thought of my friend who likes zoos, and of his funeral suit.\n“I enjoyed talking to you. Goodbye.”\n“Goodbye,” I said."};
static QUOTE_23_55_2: Minute = Minute {title: "Set My Heart to Five: A Novel", author: "Simon Stephenson", start: "“As Ness arrives at Union Station, the giant clock tells us it is ", time: "five minutes to midnight", end: ". This is significant, because humans consider midnight a time when bad things happen. Midnight is the Ides of March of the hours in the day! ‘Five minutes to midnight’ is therefore excellent foreshadowing. After all, it is almost directly equivalent to ‘Five minutes to very bad things happening’.”"};
static QUOTE_23_55_3: Minute = Minute {title: "And Then There Were None", author: "Agatha Christie", start: "Mr. Justice Wargrave said:\n“It is now ", time: "five minutes to eleven", end: ". I think we should summon Miss Brent to join our\nconclave.”"};
static QUOTE_23_55_4: Minute = Minute {title: "Harry Potter and the Prisoner of Azkaban", author: "J. K. Rowling", start: "“I am going to lock you in. It is-” he consulted his watch, “", time: "five minutes to midnight", end: ". Miss Granger, three turns should do it. Good luck.”"};
static QUOTE_23_55_5: Minute = Minute {title: "The Moonstone", author: "Wilkie Collins", start: "I looked at my watch. It wanted ", time: "five minutes to twelve", end: ", when the premonitory symptoms of the working of the laudanum first showed themselves to me. At this time, no unpractised eyes would have detected any change in him. But, as the minutes of the new morning wore away, the swiftly-subtle progress of the influence began to show itself more plainly. The sublime intoxication of opium gleamed in his eyes; the dew of a stealthy perspiration began to glisten on his face. In five minutes more, the talk which he still kept up with me, failed in coherence."};
static QUOTE_23_56_0: Minute = Minute {title: "Wicked Women", author: "Fay Weldon", start: "The human race is at the end of the line, the doomsday clock ticks on. It’s stopped for a decade at ", time: "four minutes to midnight", end: ", but there the hands still stand. Any minute now they’ll begin to move again."};
static QUOTE_23_57_0: Minute = Minute {title: "No Country for Old Men", author: "Cormac McCarthy", start: "Wells looked out at the street. “What time is it?” he said. Chigurh raised his wrist and looked at his watch. “", time: "Eleven fifty-seven", end: "” he said. Wells nodded. By the old woman’s calendar I’ve got three more minutes."};
static QUOTE_23_58_0: Minute = Minute {title: "The Tommyknockers", author: "Stephen King", start: "You got to let the world go to hell in its own way, Gard, ", time: "two minutes to midnight", end: " or not."};
static QUOTE_23_58_1: Minute = Minute {title: "A Short History of Nearly Everything", author: "Bill Bryson", start: "Humans emerge ", time: "one minute and seventeen seconds before midnight", end: ". The whole of our recorded history, on this scale, would be no more than a few seconds, a single human lifetime barely an instant."};
static QUOTE_23_59_0: Minute = Minute {title: "11:59", author: "Blondie", start: "Leaning in your corner like a candidate for wax\nSidewalk social scientist don’t get no satisfaction from your cigarette\nIt’s ten to ten and time is running out\nLock up all your memories, get outa here, you know that we can run\nToday can last another million years\nToday could be the end of me\nIt’s ", time: "11:59", end: ", and I want to stay alive"};
static QUOTE_23_59_1: Minute = Minute {title: "The Man Who Walked Through Walls", author: "Marcel Aymé", start: "At ", time: "a minute to midnight", end: ", Roquenton was holding his wife’s hand and giving her some last words of advice. On the stroke of midnight, she felt her companion’s hand melt away inside her own."};
static QUOTE_23_59_2: Minute = Minute {title: "No Country for Old Men", author: "Cormac McCarthy", start: "Chigurgh rose and picked up the empty casing off the rug and blew into it and put it in his pocket and looked at his watch. The ", time: "new day was still a minute away", end: "."};

